import React from 'react';
import './Media.css'



const Media = ({onRouteChange}) => {

	return(
		<div className = {'mediaBox'}>
			<div className = 'mygo mr5 f8 link dim white db pointer' onClick = {() => onRouteChange('signout')}>
			  {'My Go'}
			</div>
			<div className = 'mygo f8 link dim white db pointer' onClick = {() => onRouteChange('signout')}>
			  {'Host'}
			</div>
		</div>



		);



}

export default Media;
